import Home from "./Home";
import {
  FirebaseAuthConsumer,
  IfFirebaseAuthed,
  IfFirebaseUnAuthed,
} from "@react-firebase/auth";
import AboutUs from "./webpages/AboutUs";
import CompoundInterest from "./components/CompoundInterest";

function App() {
  return (
    <>
      <div>
        <FirebaseAuthConsumer>
          <IfFirebaseAuthed>
            <CompoundInterest />
          </IfFirebaseAuthed>
          <IfFirebaseUnAuthed>
            <AboutUs />
          </IfFirebaseUnAuthed> 
        </FirebaseAuthConsumer>
      </div>
    </>
  );
}

export default App;
